import React from "react";
import styled from "styled-components";

const ModalContainer = styled.div`
  width: 70%;
  height: 400px;
  align-items: center;
  justify-content: center;
  background-color: white;
  position: absolute;
  margin-top: 200px;
  border-radius: 20px;
`;

const ModalHeader = styled.div`
  width: 100%;
  height: 80px;
  background-color: purple;
  color: white;
  font-size: 30px;
  font-weight: 500;
  padding: 20px;
`;
const ModalContents = styled.div`
  width: 100%;
  color: black;
  font-size: 25px;
  font-weight: 300;
  padding: 20px;
`;

const Modal = () => {
  return (
    <ModalContainer>
      <ModalHeader>123</ModalHeader>
      <ModalContents>123123</ModalContents>
    </ModalContainer>
  );
};

export default Modal;
